import React, { useState } from 'react';
import axios from 'axios';

function CreateFile() {
  const [identification, setIdentification] = useState();
  const [names, setNames] = useState();
  const [lastName, setLastName] = useState();
  const [description, setDescription] = useState();

  

  const Submit = (e) =>{
    e.preventDefault();
    axios.post("http://localhost3001/registerFile", {identification, names, lastName, description})
    .then(result => console.log(result))
    .catch(err => console.log(err))
  }

  return (
    <div>
      <h1>Create File</h1>
      <form onSubmit={Submit}>
        <div>
          <label>Identification:</label>
          <input type="text" name="identification" onChange={(e) => setIdentification(e.target.value)} />
        </div>
        <div>
          <label>Name:</label>
          <input type="text" name="name" onChange={(e) => setNames(e.target.value)} />
        </div>
        <div>
          <label>LastName:</label>
          <input type="text" name="lastName" onChange={(e) => setLastName(e.target.value)} />
        </div>
        <div>
          <label>Description:</label>
          <input type="text" name="description"  onChange={(e) => setDescription(e.target.value)}/>
        </div>
        
        <button onClick={handleCreate}>Create File</button>
      </form>
    </div>
  );
}

export default CreateFile;
